// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awVisualIndicatorRenderFunction } from 'js/AwVisualIndicatorService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwVisualIndicatorService', () => import('js/AwVisualIndicatorService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awVisualIndicatorRenderFunction",
            "deps": "js/AwVisualIndicatorService"
        }
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "vmo": {
            "type": "viewModelObject"
        }
    },
    "_viewModelId": "AwVisualIndicator",
    "_uniqueViewModelId": "AwVisualIndicator",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awVisualIndicatorRenderFunction, undefined, ctxImportObj );

export default Component;
